import React from 'react';
import {
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol
} from 'mdb-react-ui-kit';
import styled from 'styled-components'
import { treatments } from '../../data'

const Container = styled.div`
  margin-top: 10px;
  margin-bottom: 10px;
`

const BoxImage = styled.div`
  :hover{
    cursor: pointer;
    background: #e0e0e0;
    opacity: 0.7;
  }

`
const Title = styled.h3`
  color: #966D39;
  font-weight: 400px;
  font-family: 'Reenie Beanie', cursive;
  font-size: 30px;
  margin: 10px;
`
const Spn = styled.span`
  color: #966D39;
  font-family: 'Reenie Beanie', cursive;
  font-weight: 400px;
  font-size: 26px;
`

export default function App() {
  console.log(treatments)
  return (
    <Container className='container'>
      <center>
        <Title>Conheça outros tratamentos</Title>
      </center>
      <MDBRow className='row-cols-3 row-cols-md-3 g-4'>
        <MDBCol>
          <BoxImage>
            <MDBCard>
              <MDBCardImage
                src='https://firebasestorage.googleapis.com/v0/b/facilitastorage.appspot.com/o/antonia%2Fcards%2Fpeeling.png?alt=media&token=703138ed-4b3c-4471-9e05-f91615a28615'
                alt='...'
                position='top'
              />
              <MDBCardBody>
                <MDBCardTitle>Peeling Químico</MDBCardTitle>
                <MDBCardText>
                  Remoção de camadas superficiais da pele buscando promover a renovação celular e melhorar a aparência da pele. 
                </MDBCardText>
              </MDBCardBody>
            </MDBCard>
          </BoxImage>
        </MDBCol>

      </MDBRow>
    </Container>
  );
}
